import React from 'react'
import Navbar from '../components/Navbar.js'
import { styled } from 'styled-components'

const Container =  styled.div`
    height: 60px;
`
const Home = () => {
  return (
    <Container>
        <Navbar/>
    </Container>
  )
}

export default Home
